def compare_versions(ver1,ver2):
    v1 = list(map(int, ver1.split('.')))
    v2 = list(map(int, ver2.split('.')))
    max_len = max(len(v1), len(v2))
    v1 += [0] * (max_len - len(v1))
    v2 += [0] * (max_len - len(v2))
    if v1 > v2:
        return "GT"
    elif v1 < v2:
        return "LT"
    else:
        return "EQ"

